INSERT INTO `dating_profileQuestions` VALUES (1,1,'CHAT_USERNAME',1,'Question 1 of 6: Reply with a unique username that your potential mates will use to chat with you.',0,1),(2,1,'GENDER',1,'Question 2 of 6: What is your gender <USERNAME>? Reply M for Male, F for Female',1,1),(3,1,'AGE',1,'Question 3 of 6: How old are you currently <USERNAME>? You must be 18 yrs and above. Reply with number e.g 27',2,1),(4,1,'LOCATION',1,'Question 4 of 6: Ok <USERNAME>. To find a match near your area, we need to know your location. Where are you located ? (e.g Nairobi, Runda, Buruburu) ',3,1),(5,1,'PREFERRED_AGE',1,'What minimum age would you like your match to be? Note, age must be 18 yrs & above',4,1),(6,1,'PREFERRED_GENDER',1,'Question 6 of 6: What gender would you like your match to be <USERNAME> ?  Reply M for Male, F for Female.',5,1);
