INSERT INTO `hinduquotes` VALUES (1,'HINDU_QUOTES','The great secret of true success, of true happiness, is this: the man or woman who asks for no return, the perfectly unselfish person, is the most successful.','2015-01-28 03:42:36'),(2,'HINDU_QUOTES','Our duty is wakefulness the fundamental condition of life itself.The unseen, the unheard, the untouchable is what weaves the fabric of our see-able universe','2015-01-28 03:44:20'),(3,'HINDU_QUOTES','Put your heart, mind, and soul into even your smallest acts. This is the secret of success.\"','2015-01-28 03:46:25'),(4,'HINDU_QUOTES','A grain of devotion is more valuable thank tons of faithlessness','2015-01-28 03:47:33'),(5,'HINDU_QUOTES','The more we come out and do good to others, the more our hearts will be purified, and God will be in them','2015-01-28 03:48:34'),(6,'HINDU_QUOTES','One should not be happy or distressed over desirables and undesirables, knowing that such feelings are just created by the mind.','2015-01-28 03:49:57'),(7,'HINDU_QUOTES','Desire nothing, give up all desires and be happy','2015-01-28 03:50:49'),(8,'HINDU_QUOTES','Your duty is to treat everybody with love as a manifestation of the Lord.','2015-01-28 03:51:43'),(9,'HINDU_QUOTES','You cannot believe in God until you believe in yourself.','2015-01-28 03:52:30'),(10,'HINDU_QUOTES','A spiritually illumined soul lives in the world, yet is never contaminated by it','2015-01-28 03:53:18'),(11,'HINDU_QUOTES','If faith in ourselves had been extensively taught and practiced, I am sure a very large portion of the evils and miseries that we have would have vanished.','2015-01-28 03:54:31'),(12,'HINDU_QUOTES','It is divinity that shapes, not only your ends, but also your acts, your words and thoughts.','2015-01-28 03:55:16'),(13,'HINDU_QUOTES','All differences in this world are of degree, and not of kind, because oneness is the secret of everything','2015-01-28 03:56:01');
/*!40000 ALTER TABLE `hinduquotes` ENABLE KEYS */;
UNLOCK TABLES;

