  `Type` enum('RT','OL','IC','TC','TM','VCARD','VCALENDAR','VBOOKMARK','IMELODY','SERVICEINDICATION') NOT NULL DEFAULT 'TM',
  `SendFrom` varchar(45) DEFAULT NULL,
