INSERT INTO `jokes` VALUES (6,'bar','What do you call a basement full of women? A whine cellar! ','2014-12-07 07:35:11'),(7,'bar','A chicken walks into a bar. The bartender says \"We don\'t serve poultry!\" The chicken says \"That\'s OK I just want a drink.\" ','2014-12-07 07:35:11'),(8,'bar','What did the Bartender say when two jumper cables walk into a bar. \"You guys better not start anything in here.\" ','2014-12-07 07:35:11'),(9,'bar','This grasshopper walks into a bar, and the bartender says, \"Hey! We have a drink named after you!\" The grasshopper replies, \"Really? You have a drink named Steve?!\" ','2014-12-07 07:35:11'),(10,'bar','Imagine if your fridge did what you do to it everyday. Every half hour it goes to your room opens the door, and stares at you for 5 minutes then leaves.','2015-01-27 18:22:07'),(11,'bar','The only thing I use BING for is to search Google.','2015-01-27 18:23:14'),(12,'bar','When the person you hate the most falls down, you ask the ground if its okay.','2015-01-27 18:25:02'),(13,'bar','Dear Algebra please stop asking us to find your \'x\' she is not coming back','2015-01-27 18:26:55'),(14,'bar','How to make a girl furious in 2 steps.Step 1, take a picture of her Step 2, don\'t show it to her','2015-01-27 18:27:54'),(15,'bar','Every morning, I jog around my block 15 times. Then I pick up the block and put it back in my toy chest.','2015-01-27 18:29:22'),(16,'bar','69% Percent of people will find something wrong with this sentence.','2015-01-27 18:30:31'),(17,'bar','Until 1961 it was illegal to attempt suicide in the UK. The punishment was death.','2015-01-27 18:31:46'),(18,'bar','I predict that in the future, Youtube,Twitter, and Facebook will merge to create one super time-wasting site called YouTwitFace.','2015-01-27 18:32:51'),(19,'bar','Robber: \"Give me all your money. Otherwise you are chemistry! \"\nPerson: \" Don\'t you mean history? \"\nRobber: \"Don\'t change the subject! \"\n\'Both start laughing\'','2015-01-27 18:34:08'),(20,'bar','Men at 26 plays football,Men at 40 plays tennis,Men at 60 plays golf,\nhave you noticed every time you get olderyour ball gets smaller','2015-01-27 18:35:39'),(21,'bar','The clear history button in your browser has saved more lives than Superman.','2015-01-27 18:38:02'),(22,'bar','Fool me once, shame on you. Fool me twice, shame on me. Fool me three hundred fifty thousand times, you\'re a weatherman.','2015-01-27 18:38:46'),(23,'bar','As the police put the handcuffs on me, my mother said, \"Dan, I\'ve failed you as a mother.\" \"Mom, my name is Dave.\"','2015-01-27 18:39:27'),(24,'bar','I just saw a little girl get a \"You\'re #1\" sticker. She read it, \"You\'re hashtag one.\" We\'re doomed.','2015-01-27 18:40:46'),(25,'bar','The sight of a woman\'s cleavage reduces a man\'s ability to think clearly by 50%... per boob!','2015-01-27 18:41:17'),(26,'bar','Sometimes... when you cry ... no one sees your tears... sometimes... when you are happy... no one sees your smile... But fart just one time...','2015-01-27 18:48:17'),(27,'bar','Teacher: \"You copied from Tim\'s exam paper didn\'t you?\"\nPupil: \"How did you know?\"\nTeacher: \"Tim\'s paper says \'I don\'t know\' and you put \'Me neither\'!\"','2015-01-27 18:54:33'),(28,'bar','What’s the difference between ignorance and apathy? I don’t know and I don’t care.','2015-01-27 18:59:57'),(29,'bar','Shipwreck diary Day 1: Alone. Doing well. Mentally sound. Met a crab. Day 2: I have married the crab. Day 3: I have eaten my wife.','2015-01-27 19:00:22'),(30,'bar','I wonder what ‘DON’T TOUCH’ is in Braille.','2015-01-27 19:01:06'),(31,'bar','The good thing about life is that, even if you’re crap at it, you’re guaranteed at least two certificates','2015-01-27 19:02:10'),(32,'bar','‘I’m sorry’ and ‘I apologise’ mean the same thing – unless you’re at a funeral.','2015-01-27 19:03:30'),(33,'bar','‘I stand corrected,’ said the man in the orthopaedic shoes','2015-01-27 19:04:39'),(34,'bar','Room service? Send up a larger room.','2015-01-27 19:05:37'),(35,'bar','Where there’s a will, there’s a relative.','2015-01-27 19:06:54'),(36,'bar','To err is human. To blame it on someone else shows management potentia','2015-01-27 19:08:56'),(37,'bar','Do you think that Noah had been fishing during the flood? I don`t think so… he had only two worms!','2015-01-27 19:14:14');
