INSERT INTO `message` VALUES (1,1,'UNKNOWN_KEYWORD_ADVICE','Unknown keyword. Reply with MENU to see available services. Looking for a date? Reply with the word \'date\' and we\'ll find a match for you!'),(2,1,'MAIN_MENU_ADVICE','Reply with number to see sub-menu, 0 to go back. SMS cost 0.0/-'),(3,1,'CONFIRMED_SUBSCRIPTION_ADVICE','You\'ve been subscribed to \"<SERVICE_NAME>\". Quality content sent daily. Cost <SMS_SUBSCRIPTION_PRICE> /- @sms. To unsubscribe, reply \"STOP <KEYWORD>\". Reply 0 to go back to menu.'),(5,1,'SUBSCRIPTION_ADVICE','Reply with corresponding number to subscribe, 0 to go back.'),(6,1,'ALREADY_SUBSCRIBED_ADVICE','You\'re already subscribed to <KEYWORD>. If you want to unsubscribe, reply \"STOP <KEYWORD>\"'),(7,2,'MAIN_MENU_ADVICE','Reply with number, 0 to go back. SMS cost 0.0/-'),(8,2,'SUBSCRIPTION_ADVICE','You\'ve been subscribed to <SERVICE>. SMS Cost <PRICE>/- daily.'),(9,1,'DOUBLE_CONFIRMATION_ADVICE','Reply with \"ON <CHOSEN>\" to confirm content subscription to <SERVICE_NAME>,  0 To go back.'),(10,2,'CONFIRMED_SUBSCRIPTION_ADVICE','You\'ve been subscribed to \"<SERVICE_NAME>\". Quality content sent daily. Cost <SMS_SUBSCRIPTION_PRICE> /- @sms. To unsubscribe, reply \"STOP <KEYWORD>\". Reply 0 to go back to menu.'),(11,2,'ALREADY_SUBSCRIBED_ADVICE','You\'re already subscribed to <SERVICE_NAME>.  SMS Cost <PRICE>/- daily.'),(12,1,'NO_PENDING_SUBSCRIPTION_ADVICE','You don\'t have any pending subscriptions'),(13,1,'UNSUBSCRIBED_SINGLE_SERVICE_ADVICE','We are sad to see you go :( You\'ve been unsubscribed from <SERVICE_NAME> and you\'ll no longer receive content from the service. Are you lonesome? Reply with \'DATE\' and we\'ll find someone for you.'),(14,1,'UNSUBSCRIBED_ALL_ADVICE','You\'ve been unsubscribed from all services. Reply with MORE for more interesting content.'),(15,1,'INDIVIDUAL_UNSUBSCRIBE_ADVICE','Reply with \"STOP #\" where # is the number corresponding to the service you want to unsubscribe from.'),(16,1,'NOT_SUBSCRIBED_TO_ANY_SERVICE_ADVICE','You\'re not subscribed to any service.'),(17,1,'DATING_SUCCESS_REGISTRATION','Please answer some questions to complete your dating profile.'),(18,2,'DATING_SUCCESS_REGISTRATION','Answer only 6 questions to complete your dating profile.'),(19,1,'USERNAME_NOT_UNIQUE_TRY_AGAIN','The username  \"<USERNAME>\" you chose is not unique. Please reply with another username.'),(20,2,'USERNAME_NOT_UNIQUE_TRY_AGAIN','The username  \"<USERNAME>\" you chose is not unique. Please reply with another username.'),(21,1,'PROFILE_COMPLETE','Congratulations <USERNAME>! Your dating profile is complete. Now sit back, relax and wait for us to find a match for you near your area.'),(22,2,'PROFILE_COMPLETE','Congratulations <USERNAME>! Your dating profile is complete. Now sit back, relax and wait for us to find a match for you near your area.'),(23,1,'AGE_NUMBER_INCORRECT','Sorry <USERNAME>, we didn\'t understand age specified. Please reply with a number representing age in years. For example 23'),(24,2,'AGE_NUMBER_INCORRECT','Sorry <USERNAME>, we didn\'t understand age specified. Please reply with a number representing age in years. For example 23'),(25,1,'SERVICE_FOR_18_AND_ABOVE','Sorry <USERNAME>, this service is only for adults who are 18 years and above. The age you specified does not qualify for this service.'),(26,2,'SERVICE_FOR_18_AND_ABOVE','Sorry <USERNAME>, this service is only for adults who are 18 years and above. The age you specified does not qualify for this service.'),(35,1,'GENDER_NOT_UNDERSTOOD','Sorry, gender not understood. Please specify either MALE or FEMALE.'),(36,2,'GENDER_NOT_UNDERSTOOD','Sorry, gender not understood. Please specify either MALE or FEMALE.');
