DROP TABLE IF EXISTS `smsstatlog`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `smsstatlog` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `SMSServiceID` int(11) NOT NULL,
  `timeStamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `msisdn` varchar(45) DEFAULT NULL,
  `charged` tinyint(4) NOT NULL DEFAULT '0',
  `transactionID` varchar(45) NOT NULL,
  `statusCode` enum('LimitSubscriberFailure','InvalidSubscriber','KeywordsNotFound','TariffCodeNotFound','Invalidshortcode','SetCMPConnectionFailure','ServicePriceNotFound','PSAInsufficientBalance','PSAInvalidNumber','PSANumberBarred','PSABusy','PSACreditExceeded','PSAChargeFailure','SCRNotInAllowList','SubscriberBlackListed','PCMSendFail','NegativeDN','Success','PCM200','PCM301','PCM302','PCM303','PCM304','PCM305','PCM306','PCM307','PCM400','PCM402','PCM403','PCM404','PCM405','PCM406','WaitingForDLR','NO_BILLING_REQUIRED','WAITING_BILLING','BILLING_INPROGRESS','SUCCESSFULLY_BILLED','BILLING_FAILED','BILLING_FAILED_PERMANENTLY','INSUFFICIENT_FUNDS') NOT NULL DEFAULT 'WaitingForDLR',
  `subscription` tinyint(4) NOT NULL DEFAULT '0',
  `CMP_Keyword` varchar(45) NOT NULL,
  `CMP_SKeyword` varchar(45) NOT NULL,
  `price` double NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `transactionID` (`transactionID`),
  KEY `timeStamp` (`timeStamp`),
  KEY `msisdn` (`msisdn`),
  KEY `cmp_keywords` (`CMP_Keyword`,`CMP_SKeyword`),
  KEY `cmpKeyWord` (`CMP_Keyword`),
  KEY `cmpSKeyword` (`CMP_SKeyword`),
  KEY `statusCode_idx` (`statusCode`),
  KEY `price` (`price`),
  KEY `price_statusCod_idx` (`price`,`statusCode`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

