INSERT INTO `static_content` VALUES (1,'ROMANCE','Light up the fire under your Valentine with these cute and romantic valentine poems. Make sure valentine.s day becomes the brightest star of the year. Let it shine the spotlight of love excellent and desired by all.','2014-12-21 12:24:57'),(2,'ROMANCE','Girl: Why my name is always on your Facebook status in every 2 minutes? Boy: Facebook keeps asking me what\'s on my mind ? And honestly, it\'s always you.','2014-12-21 12:24:57'),(3,'ROMANCE','Can i take your photo? girl: what for? boy: so that i can show santa claus what i want for christmas.','2014-12-21 12:24:57'),(4,'ROMANCE','Anyone Can Make You Smile, Many People Can Make You Cry, But It Takes Someone Really Special To Make You Smile With Tears In Your Eyes.','2014-12-21 12:24:57'),(5,'ROMANCE','Beautiful lines by a lover.... . The Next Gal I\"ll ever love will be our Daughter.','2014-12-21 12:24:57'),(6,'ROMANCE','nice words by a boy who truly loves a girl.......... \'my 1 hand is enough 2 fight against the world if u hold d another one.','2014-12-21 12:24:57'),(7,'ROMANCE','Last night when I was thinking of you, A tear of mine rolled out.. \'\'Why did you roll out???\'\' I asked A reply came. \'\' I can\'t find any space for me coz there\'s someone so beautiful there.','2014-12-21 12:24:57'),(8,'ROMANCE','One Day You Asked Me, Whether I Love You More Or My Life And I Said \'\' My Life \'\' You Walked Away With Tears In Your Eyes Without Knowing That You Are \'\' My Life.','2014-12-21 12:24:57'),(9,'ROMANCE','Love warms your soul and makes life easy, enjoyable and worthwhile.','2014-12-21 12:24:58'),(10,'ROMANCE','Love is a positive state of being so powerful that it can overshadow even the dreariest of circumstances.','2014-12-21 12:24:58'),(11,'ROMANCE','I feel so safe In your embrace You fill me with faith, Peace, love and grace.','2014-12-21 12:24:58'),(12,'ROMANCE','You are my love From now till death I thank stars above For your faithfulness.','2014-12-21 12:24:58'),(13,'ROMANCE','My heart is broken My love is your token To find all my charms  Hold me in your arms.','2014-12-21 12:24:58'),(14,'ROMANCE','It\'s finally Valentine\'s Day I have been waiting all year Now I can sneak a kiss and play And keep my intentions near.','2014-12-21 12:24:58'),(15,'ROMANCE','It is Valentine\'s Day So what do you say? Will you give me a kiss? You cute little miss? ','2014-12-21 12:24:58'),(16,'ROMANCE','Don\'t pass up your chance, We can dine and dance. We can roam the town Until the sun goes down.','2014-12-21 12:24:58'),(17,'ROMANCE','Please be mine Be my Valentine. Not for one day, But forever stay.','2014-12-21 12:24:58'),(18,'ROMANCE','Love is true. Love is golden. Love for you My beholden.','2014-12-21 12:24:58'),(19,'ROMANCE','Your love is like the ocean, Vast, spacious and deep. You have given me your potion Of love that I must keep.','2014-12-21 12:24:58'),(20,'ROMANCE','I am collecting Valentines Some red, some green, some blue, Some big, some small, all very fine And I am going to give them all to you.','2014-12-21 12:24:58'),(21,'ROMANCE','Valentine dear, I want you true. Praying Cupid will get his bow, Pull back his arrow, aim it at you So love for me you will know.','2014-12-21 12:24:58'),(22,'ROMANCE','Your love is so pure, Whitest of whites. Teddy bear\'s fur And cleanest of nights.','2014-12-21 12:24:58'),(23,'ROMANCE','It is All Hearts Day With flowers all around. Please tell me, just say You will always be \'round.','2014-12-21 12:24:58'),(36,'MCHONG','Uko na shoulders broad hadi ukidance helicopter unatake off.','2014-12-21 12:34:21'),(37,'MCHONG','Uko down hadi ulikuwa unafikiria Youtube ni contraceptive.','2014-12-21 12:34:21'),(38,'MCHONG','Wee ni mu ugly hadi ukiwa mtoi mama yako alikuwa anakushow, kula ama nilete kioo.','2014-12-21 12:34:21'),(39,'MCHONG','Wee ni mrough hadi ukiguza mouse comp inashow NEW HARDWARE DETECTED.','2014-12-21 12:34:21'),(40,'MCHONG','Uko na kichwa biggy ukingia daro mode anakushow hakuna group work.','2014-12-21 12:34:21'),(41,'MCHONG','Naskia ati we ni zuzu ulipaint aerial ya tv yako ndio uone coloured.','2014-12-21 12:34:22'),(42,'MCHONG','Naskia we ni lazy huwezi jump into conclusion.','2014-12-21 12:34:22'),(43,'MCHONG','Naskia ng\'ombe zenu zimechan mpaka zikivuka mto zinakunja ngozi.','2014-12-21 12:34:22'),(44,'MCHONG','Ujinga ni kulala njaa na uko na adam\'s apple.','2014-12-21 12:34:22'),(45,'MCHONG','Ujinga ni \"kununua kiberiti na ku taste ka zote zinawaka.','2014-12-21 12:34:22'),(46,'MCHONG','wewe ni mnono hadi ukikanyaga bob inakuwa sumni mbili.','2014-12-21 12:34:22'),(47,'MCHONG','msee ni fala hadi the first time alibai sausage aliambia uyo msee. npe carrot choma.','2014-12-21 12:34:22'),(48,'MCHONG','ati tv yenu ina ushamba mpaka DEXTER anabonga kikamba.','2014-12-21 12:34:22'),(49,'MCHONG','Ujinga ni Kuuliza Fb ina pg gapi.','2014-12-21 12:34:22'),(50,'MCHONG','Budako amezoea kuride byk hadi akiingia kwa mat anakunja trao.','2014-12-21 12:34:22'),(51,'MCHONG','una mdomo kubwa mpaka unatoa collabo mwenyewe.','2014-12-21 12:34:22'),(52,'ISLAMQ','Meaning of ISLAM : I = I (Myself) S = Surrender L = Law(s) A =Allah M = Mohammad.','2014-12-21 12:38:07'),(53,'ISLAMQ','Who so ever prays a lot during the month of Ramadhan will have his load lightened on the day of measure.','2014-12-21 12:38:07'),(54,'ISLAMQ','Happy Moments - PRAISE ALLAH Difficult Moments- SEEK ALLAH Quiet Moments - WORSHIP ALLAH Painful Moments - TRUST ALLAH Moment By Moment - THANK ALLAH.','2014-12-21 12:38:07'),(55,'ISLAMQ','When all the doors seem to be closed in front of you, look QURAAN.! There will surely be a window opened enlightening you with new hopes & GUIDANCE.','2014-12-21 12:38:07'),(56,'ISLAMQ','Verily, Allah does not look towards your bodies nor towards your appearances. But, he looks towards your hearts.','2014-12-21 12:38:07'),(57,'ISLAMQ','ISLAM is the University,WORLD is the Class room,QURAN is the Syllabus,MUHAMMAD (PBUH) is the Teacher,ALLAH is the Examiner,Try to pass the final Exam. All The Best.','2014-12-21 12:38:07'),(58,'ISLAMQ','When problems are so big and, your strength is no longer enough, to carry them, don.t give up, Coz where your strength ends,the grace of ALLAH begins.','2014-12-21 12:38:08'),(59,'BIBLEQ','Thank you Father for never leaving me. No matter when I call on your name, you are always there waiting to hear from me. I Love You Lord! .The Lord is near to all who call upon Him.. Psalms 145:18.','2014-12-21 12:42:37'),(60,'BIBLEQ','Thank you Lord for breathing life into us. .This is the day the Lord has made; we will rejoice and be glad in it.. Psalms 118:24.','2014-12-21 12:42:37'),(61,'BIBLEQ','Trust in the LORD with all thine heart; and lean not unto thine own understanding. In all thy ways acknowledge him, and he shall direct thy paths.. Proverbs 3:5-6.','2014-12-21 12:42:37'),(62,'BIBLEQ','Fear note, for I am with you; be not dismayed, for I am your God. I will strengthen you, yes, I will help you, i will uphold you with My righteous right hand.. Isaiah 41:10.','2014-12-21 12:42:37'),(63,'BIBLEQ','Leave your worries in God.s hands. He has doors that He wants to open for you. .Therefore do not worry about tomorrow, for tomorrow will worry about its own things.. Matthew 6:34.','2014-12-21 12:42:37'),(64,'BIBLEQ','God will forgive you. All you need to do is ask, believe, and receive it. .And forgive us our debts, as we forgive our debtors.. Matthew 6:12.','2014-12-21 12:42:37'),(65,'BIBLEQ','God will forgive you. All you need to do is ask, believe, and receive it. .And forgive us our debts, as we forgive our debtors.. Matthew 6:12.','2014-12-21 12:42:37'),(66,'BIBLEQ','Bible quotes are very important and they have a huge role, each citation contains teachings and the word of God, each quotes is one more step to the knowledge of God.','2014-12-21 12:42:37'),(67,'BIBLEQ','Jeremiah 29:11 For I know the plans I have for you, declares the LORD, plans for welfare and not for evil, to give you a future and a hope.','2014-12-21 12:42:38'),(68,'BIBLEQ','Zephaniah 3:17 The LORD your God is in your midst, a mighty one who will save; he will rejoice over you with gladness; he will quiet you by his love; he will exult over you with loud singing.','2014-12-21 12:42:38'),(69,'BIBLEQ','Romans 15:13  May the God of hope fill you with all joy and peace in believing, so that by the power of the Holy Spirit you may.','2014-12-21 12:42:38'),(70,'BIBLEQ','Isaiah 41:10  fear not, for I am with you;  be not dismayed, for I am your God; I will strengthen you, I will help you,  I will uphold you with my righteous right hand.','2014-12-21 12:42:38'),(71,'BIBLEQ','Psalm 18:32-34  the God who equipped me with strength and made my way blameless. He made my feet like the feet of a deer  and set me secure on the heights. He trains my hands for war, so that my arms can bend a bow of bronze.','2014-12-21 12:42:38'),(72,'BIBLEQ','1 Corinthians 10:13  No temptation has overtaken you that is not common to man. God is faithful, and he will not let you be tempted beyond your ability, but with the temptation he will also provide the way of escape, that you may be able to endure it.','2014-12-21 12:42:38'),(73,'BIBLEQ','Deuteronomy 7:9 Know therefore that the LORD your God is God, the faithful God who keeps covenant and steadfast love with those who love him and keep his commandments, to a thousand generations.','2014-12-21 12:42:38'),(74,'BIBLEQ','Psalm 32:8 I will instruct you and teach you in the way you should go; I will counsel you with my eye upon you.','2014-12-21 12:42:38'),(75,'BIBLEQ','John 6:47 Truly, truly, I say to you, whoever believes has eternal life.','2014-12-21 12:42:38'),(76,'BIBLEQ','1 John 5:14 And this is the confidence that we have toward him, that if we ask anything according to his will he hears us.','2014-12-21 12:42:38'),(77,'BIBLEQ','Psalm 136:26 Give thanks to the God of heaven, for his steadfast love endures forever.','2014-12-21 12:42:38'),(78,'BIBLEQ','Revelation 21:4 He will wipe away every tear from their eyes, and death shall be no more, neither shall there be mourning, nor crying, nor pain anymore, for the former things have passed away..','2014-12-21 12:42:38'),(79,'BIBLEQ','Psalm 136:26 Give thanks to the God of heaven, for his steadfast love endures forever.','2014-12-21 12:42:38'),(80,'BIBLEQ','Deuteronomy 31:6 Be strong and courageous. Do not fear or be in dread of them, for it is the LORD your God who goes with you. He will not leave you or forsake you.','2014-12-21 12:42:38'),(81,'BIBLEQ','Romans 13:8  Owe no one anything, except to love each other, for the one who loves another has fulfilled the law.','2014-12-21 12:42:38'),(82,'BIBLEQ','Galatians 5:13  For you were called to freedom, brothers. Only do not use your freedom as an opportunity for the flesh, but through love serve one another.','2014-12-21 12:42:38'),(83,'BIBLEQ','Ephesians 4:2 with all humility and gentleness, with patience, bearing with one another in love.','2014-12-21 12:42:38'),(84,'BIBLEQ','1 Peter 1:22  Having purified your souls by your obedience to the truth for a sincere brotherly love, love one another earnestly from a pure heart.','2014-12-21 12:42:38'),(85,'BIBLEQ','1 John 4:7  Beloved, let us love one another, for love is from God, and whoever loves has been born of God and knows God.','2014-12-21 12:42:38'),(86,'BIBLEQ','Philippians 2:2  complete my joy by being of the same mind, having the same love, being in full accord and of one mind.','2014-12-21 12:42:38'),(87,'BIBLEQ','1 John 3:18 Little children, let us not love in word or talk but in deed and in truth.','2014-12-21 12:42:38'),(88,'BIBLEQ','Psalm 31:16 Make your face shine on your servant;  save me in your steadfast love.','2014-12-21 12:42:38'),(89,'BIBLEQ','Psalm 63:3 Because your steadfast love is better than life, my lips will praise you.','2014-12-21 12:42:38'),(90,'BIBLEQ','Proverbs 10:12 Hatred stirs up strife, but love covers all offenses.','2014-12-21 12:42:38'),(91,'BIBLEQ','Proverbs 17:17  A friend loves at all times, and a brother is born for adversity.','2014-12-21 12:42:38'),(92,'BIBLEQ','Proverbs 24:20 for the evil man has no future; the lamp of the wicked will be put out.','2014-12-21 12:42:39'),(93,'BIBLEQ','Proverbs 24:14 Know that wisdom is such to your soul; if you find it, there will be a future, and your hope will not be cut off.','2014-12-21 12:42:39'),(94,'BIBLEQ','Jeremiah 29:11 For I know the plans I have for you, declares the LORD, plans for welfare and not for evil, to give you a future and a hope.','2014-12-21 12:42:39'),(95,'CHRISTMASQ','He who has not Christmas in his heart will never find it under a tree ~ Roy L. Smith.','2014-12-21 12:45:15'),(96,'CHRISTMASQ','Christmas isn.t a time nor a season, but a state of mind. To cherish peace and goodwill, to be plenteous in mercy, is to have the real spirit of Christmas.','2014-12-21 12:45:15'),(97,'CHRISTMASQ','Christmas waves a magic wand over this world, and behold, everything is softer and more beautiful.','2014-12-21 12:45:15'),(98,'CHRISTMASQ','May the Joys of the Season fill your heart with goodwill and cheer. May the chimes of Christmas glory add more shine and spread Smiles across, Today & in the New Year.','2014-12-21 12:45:15'),(99,'CHRISTMASQ','To your enemy, forgiveness an opponent, tolerance a friend, your heart customer, service all, charity every child, a good example yourself, respect.','2014-12-21 12:45:15'),(100,'CHRISTMASQ','Won\'t you give me a Christmas huddle topped with a kiss and hug? Christmas is the time to cuddle Christmas is the time for love.','2014-12-21 12:45:15'),(101,'CHRISTMASQ','A silent night, a star above, a blessed gift of hope and love. Have a blessed Christmas and Happy New Year.','2014-12-21 12:45:15'),(102,'CHRISTMASQ','Joy resounds in the hearts of those who believe in the miracle of christmas. wishing you all the peace, joy love this christmas. merry christmas.','2014-12-21 12:45:16'),(103,'CHRISTMASQ','May the Spirit of Christmas bring you Peace, the gladness of Christmas give you hope the warmth of Christmas grant you Love. Merry Christmas.','2014-12-21 12:45:16'),(104,'CHRISTMASQ','If one night a big fat man jumps in at your window, grabs you and puts you in a sack don\'t worry I told Santa I wanted you for CHRISTMAS.HAPPY CHRISTMAS.','2014-12-21 12:45:16'),(105,'CHRISTMASQ','1 little star on the top of the tree 2 little presents underneath for me 3 silver ropes twisted around the tree 4 colored light shining prettily 5 shining halls flowing silvery Oh, what a sight for use to see.','2014-12-21 12:45:16'),(106,'CHRISTMASQ','Here.s hoping that your Christmas is as special as you are. Merry Christmas.','2014-12-21 12:45:16'),(107,'CHRISTMASQ','Christmas is a time when everybody wants his past forgotten and his present remembered. What I don\'t like about office Christmas parties is looking for a job the next day.','2014-12-21 12:45:16'),(108,'CHRISTMASQ','Here.s hoping that your Christmas is as special as you are. Merry Christmas.','2014-12-21 12:45:16'),(109,'CHRISTMASQ','Small pleasures... Sweet memories... Merry Christmas to you.','2014-12-21 12:45:16'),(110,'CHRISTMASQ','LIFE ends when you stop dreaming, HOPE is lost when you stop believing, and LOVE fails when you stop caring\" MERRY CHRISTMAS.','2014-12-21 12:45:16'),(111,'CHRISTMASQ','Love,Peace and Joy came down on earth on Christmas day to make you Happy and Cheerful. May Christmas spread smile in your lives! Merry Christmas.','2014-12-21 12:45:16'),(112,'CHRISTMASQ','No Greeting Card To Give.. No Sweet Flowers To Send.. No Cute Graphics To Forward.. Just A LOVING HEART Saying HAPPY X\'MAS.','2014-12-21 12:45:16'),(113,'CHRISTMASQ','Let.s welcome the year which is fresh and new, let.s cherish each moment it beholds, let.s celebrate this blissful New year. Merry X-mas.','2014-12-21 12:45:18'),(114,'VALENTINE','Don\'t wait until it\'s too late to tell someone how much you love, how much you care. Because when they\'re gone, no matter how loud you shout and cry, they won\'t hear you anymore.','2014-12-21 12:47:58'),(115,'VALENTINE','The Right Moment is really here for me to tell the 3 little words I.ve been trying so long to say BE MY VAENTINE.','2014-12-21 12:47:58'),(116,'VALENTINE','24hrs make a lovely day,7 days make a lovely week,52 weeks make a lovely year & knowing a person like So Many Time.','2014-12-21 12:47:58'),(117,'VALENTINE','Memories r treasured no1 can steal. Parting is heartache no1 can heal. Sum\'ll 4get u wen ur gone but i\'ll remember u no matter how long.','2014-12-21 12:47:58'),(118,'VALENTINE','48+2 Members can sit in a Bus. 5+1 can sit in a Car. 3+1 can sit in a auto 1+1 can sit in a Bike. Only 1 can sit in my Heart, That.s U My dear valentine.','2014-12-21 12:47:58'),(119,'FUNFACTS','Did you know that every cat has 32 different muscles in each ear.','2014-12-21 12:51:10'),(120,'FUNFACTS','The brain of an octopus is actually smaller than its eye?','2014-12-21 12:51:10'),(121,'FUNFACTS','Were you aware that tigers not only have striped fur, but even their skin is striped as well?','2014-12-21 12:51:10'),(122,'FUNFACTS','Napoleon Bonaparte actually drew up his battle plans inside of a sandbox.','2014-12-21 12:51:10'),(123,'FUNFACTS','If you yelled for 8 years, 7 months and 6 days, you would have produced enough sound energy to heat one cup of coffee. ','2014-12-21 12:51:10'),(124,'FUNFACTS','If you fart consistently for 6 years and 9 months, enough gas is produced to create the energy of an atomic bomb.','2014-12-21 12:51:10'),(125,'FUNFACTS','The human heart creates enough pressure when it pumps out to the body to squirt blood 30 feet.','2014-12-21 12:51:10'),(126,'FUNFACTS','On average people fear spiders more than they do death.','2014-12-21 12:51:10'),(127,'FUNFACTS','The strongest muscle in the body is the tongue.','2014-12-21 12:51:11'),(128,'FUNFACTS','You can\'t kill yourself by holding your breath.','2014-12-21 12:51:11'),(129,'FUNFACTS